import TaskForm from './TaskForm/TaskForm';
import './NewTask.css'

const NewTask = (props) => {
    const formHandler = (taskObj) => {
        props.onSaveNewTask(taskObj);
    }

    return (
        <div className='new-task-container'>
            <TaskForm onSaveTaskForm={formHandler} />
        </div>
    );
}

export default NewTask;
